 * await sdk.magento.createCustomerAddress(address);
 * ```
 *
 * @example
 *
 * Creating a custom GraphQL query
 * ```ts
 * module.exports = {
 *   integrations: {
 *     magento: {
 *       customQueries: {
 *         'create-customer-address-custom-query': ({ variables, metadata }) => ({
 *            variables,
 *            query: `
 *              mutation createCustomerAddress($input: CustomerAddressInput!) {
